import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useParams
} from "react-router-dom";
export default function Home() {

  let { address } = useParams();
  let number = address.split('-')[0]
  let tld = address.split('-')[1] + '-' + address.split('-')[2] 

  return(
    <div>
   <h2>{address}</h2>
   <div>
   Neighbours:
     <ul>
          <li>
            <Link to="/{number+2}-{tld}">{number+2}-{tld}</Link>
          </li>
          <li>
            <Link to="/{number-2}-{tld}">{number-2}-{tld}</Link>
          </li>
        </ul>
        </div>
        </div>
   )
}
